import React from 'react';
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper/modules';

import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

const MySwiper = () => {
  return (
    <Swiper
      // install Swiper modules
      modules={[Navigation, Pagination, Scrollbar, A11y]}
      spaceBetween={50}
      slidesPerView={3}
      navigation
      pagination={{ clickable: true }}
      scrollbar={{ draggable: true }}
      onSwiper={(swiper) => console.log(swiper)}
      onSlideChange={() => console.log('slide change')}
    >
      <SwiperSlide>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Card 1</h2>
          <p className="text-gray-600">Content for Slide 1 goes here.</p>
        </div>
      </SwiperSlide>
      
      <SwiperSlide>
      <div className="grid gap-4 p-12 bg-white">
              {/* Blocks within each card */}
              <div className="border p-4 rounded-md">Block 1</div>
              <div className="border p-4 rounded-md">Block 2</div>
              <div className="border p-4 rounded-md">Block 3</div>
              <div className="border p-4 rounded-md">Block 4</div>
              <div className="border p-4 rounded-md">Block 5</div>
              <div className="border p-4 rounded-md">Block 6</div>
            </div>

      </SwiperSlide>

      <SwiperSlide>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Card 3</h2>
          <p className="text-gray-600">Content for Slide 3 goes here.</p>
        </div>
      </SwiperSlide>

      <SwiperSlide>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Card 4</h2>
          <p className="text-gray-600">Content for Slide 4 goes here.</p>
        </div>
      </SwiperSlide>

      </Swiper>
  );
};

export default MySwiper;
